import React from 'react';
import ExampleComponent from './components/ExampleComponent';

const App = () => {
    return (
        <div>
            <h1>Welcome to the React App</h1>
            <ExampleComponent message="Hello from ExampleComponent!" />
        </div>
    );
};

export default App;
